import React, { useState } from "react";
import { Table } from 'antd';

const columns = [
  {
    title: 'mentor',
    width: 100,
    dataIndex: 'mentor',
    key: 'mentor',
    fixed: 'left',
  },
  {
    title: 'Companies',
    width: 100,
    dataIndex: 'Companies',
    key: 'Companies',
    fixed: 'left',
  },
  {
    title: 'Action',
    key: 'operation',
    fixed: 'right',
    width: 100,
    render: () => <a>reschedule</a>,
  },
];


const TableReschedule = ({pendingMeetings}) => {

  return (
  <Table 
  columns={columns} 
  dataSource={pendingMeetings} 
  scroll={{ x: "max-content" }}  
  pagination={{ pageSize: 50 }} 
  />
    );
  }

export default TableReschedule;
